import React from 'react';
import Sensordisplay from "./sensordisplay";

const Autocontrolpage = () => {
    return(
        <div>
            <h2>Autocontrol Page</h2>
            <div>
            정렬
            <button >+ 추가</button>
            </div>
            <div className="sensorbocck">{Sensordisplay(1000,true)}</div>
        </div>
    )
}

export default Autocontrolpage;
